// import { Text } from React
import logo from './logo.svg';
import './App.css';
import React from 'react';
import { Route, Switch, Redirect, NavLink } from 'react-router-dom';

function App() {
  return (

    <div style={{flex: 1, backgroundColor: 'blue'}}>
      <header style={{height: '100vh'}} className="App-header">
        <img src={logo} style={{flex: 1 }}className="App-logo" alt="logo" />

        <div style={{
          flex: 1, width: '100vh', justifyContent: 'center', backgroundColor: 'green'
        }}
        className='Test'
          >
          <p style={{textAlign: 'center', width: 500 }}> 
            This is a test
          </p>
        </div>

        <div style={{flex: 1, justifyContent: 'center', alignContent: 'center'}}>
          <a
            style={{}}
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
        </div>

      </header>
      {/* <div style={{backgroundColor: 'green', height: '100vh'}}>

      </div> */}
    </div>
  );
}

export default App;
